import React from 'react';
import bgvid from '../public/files/bgvid.mp4';

function Home() {
    return (
        <div className="banner">
            <video src={bgvid} type="video/mp4" autoPlay muted loop></video>
            <div className="content" id="home">
                <h1>TRAVEL-TRIBE</h1>
                <p>Plan your trip with us and travel around the world with the most affordable packages!</p>
                <a href="/register" className="button">Register Now!</a>
            </div>
        </div>
    );
}

export default Home;
